import Link from 'next/link';
import classNames from 'classnames';

const Container = styled.div`
    min-height: 70px;
    margin: 0 auto;
    width: 100%;
    padding: 0 10%;
    position: absolute;
    z-index: 1;
`;

const Footer = ({ classes, children, ...restProps }) => {
    return(
        <Container>
            <p>hello</p>
        </Container>
    )
}



export default Footer;
